-- Stores Data
CREATE TABLE IF NOT EXISTS Stores1 (
  id INT PRIMARY KEY,
  name TEXT NOT NULL,
  address TEXT NOT NULL
);

CREATE TABLE IF NOT EXISTS Stores2 (
  id INT PRIMARY KEY,
  name TEXT NOT NULL,
  address TEXT NOT NULL
);

CREATE TABLE IF NOT EXISTS Stores3 (
  id INT PRIMARY KEY,
  name TEXT NOT NULL,
  address TEXT NOT NULL
);


-- Products
CREATE TABLE IF NOT EXISTS Products (
  id INT PRIMARY KEY,
  name TEXT NOT NULL,
  barcode TEXT NOT NULL,
  price REAL NOT NULL,
  discount REAL NOT NULL
);


-- Employees
CREATE TABLE IF NOT EXISTS Employees (
  id INT PRIMARY KEY,
  full_name TEXT NOT NULL, 
  dob timestamp NOT NULL, 
  work_email TEXT NOT NULL, 
  phone_number TEXT NOT NULL, 
  salary REAL NOT NULL, 
  jobTitle TEXT NOT NULL, 
  store_id INT NOT NULL
);


-- Inventory3  
CREATE TABLE IF NOT EXISTS Inventory3 (
  id INT PRIMARY KEY,
  product_id INT NOT NULL,
  store_id INT NOT NULL,
  item_count INT NOT NULL,
  CONSTRAINT inventory_product FOREIGN KEY (product_id) references Products(id)
);


CREATE TABLE IF NOT EXISTS Sales2 (
  id INT PRIMARY KEY,
  product_id INT NOT NULL,
  employee_id INT NOT NULL, 
  store_id INT NOT NULL, 
  price REAL NOT NULL, 
  timestamp TIMESTAMP NOT NULL,
  CONSTRAINT sales2_product FOREIGN KEY (product_id) REFERENCES Products(id),
  CONSTRAINT sales2_employees FOREIGN KEY (employee_id) REFERENCES Employees(id)
);


CREATE TABLE IF NOT EXISTS Sales3 (
  id INT PRIMARY KEY,
  product_id INT NOT NULL,
  employee_id INT NOT NULL, 
  store_id INT NOT NULL, 
  price REAL NOT NULL, 
  timestamp TIMESTAMP NOT NULL,
  CONSTRAINT sales3_product FOREIGN KEY (product_id) REFERENCES Products(id),
  CONSTRAINT sales3_employees FOREIGN KEY (employee_id) REFERENCES Employees(id)
);

